import React, { useState } from "react";
import "./App.css"; // Import your styles

function App() {
  const [rawData, setRawData] = useState("");
  const [students, setStudents] = useState([]);
  const [minGroupSize, setMinGroupSize] = useState(0);
  const [maxGroupSize, setMaxGroupSize] = useState(0);
  const [groups, setGroups] = useState([]);

  function handlePaste(e) {
    setRawData(e.target.value);
  }

  function parseAndDisplayStudents() {
    const rows = rawData.split('\n');
    const studentsArr = rows.map(row => {
      const cells = row.split('\t');
      return {
        name: cells[0],
        grade: cells[1],
        pronoun: cells[2]
      }
    });
    setStudents(studentsArr);
  }

  function generateGroups() {
    const groupArr = [];
    const remainingStudents = [...students];
    let remainingGroupSize = students.length;
    for (let i = 0; i < groups.length; i++) {
      const groupSize = Math.floor(Math.random() * (maxGroupSize - minGroupSize + 1) + minGroupSize);
      remainingGroupSize -= groupSize;
      const group = remainingStudents.splice(0, groupSize);
      groupArr.push(group);
    }
    if (remainingGroupSize > 0) {
      let i = 0;
      while (remainingStudents.length > 0) {
        groupArr[i].push(remainingStudents.pop());
        i = (i + 1) % groupArr.length;
        remainingGroupSize--;
      }
    }
    setGroups(groupArr);
  }



  return (
    <div className="App">
      <h1>Group Generator</h1>
      <textarea
        onChange={handlePaste}
        placeholder="Paste cells from Google Sheet here..."
      />
      <button onClick={parseAndDisplayStudents}>Display Students</button>
      <div>
        <label>
          Min group size:
          <input
            type="number"
            value={minGroupSize}
            onChange={(e) => setMinGroupSize(e.target.value)}
          />
        </label>
        <label>
          Max group size:
          <input
            type="number"
            value={maxGroupSize}
            onChange={(e) => setMaxGroupSize(e.target.value)}
          />
        </label>
      </div>
      <button onClick={generateGroups}>Generate Groups</button>
      <div className="students">
        <h2>Students</h2>
        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Grade</th>
              <th>Pronoun</th>
            </tr>
          </thead>
          <tbody>
            {students.map(student => (
              <tr key={student.name}>
                <td>{student.name}</td>
                <td>{student.grade}</td>
                <td>{student.pronoun}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      <div className="groups">
  <h2>Groups</h2>
  <table>
    <tbody>
      {groups.map((group, index) => (
        <React.Fragment key={index}>
          <tr>
            <th>Group Number {index + 1}</th>
            <th>Students</th>
          </tr>
          {group.map((student, index) => (
            <tr key={`${index}-${student.name}`}>
              <td></td>
              <td>{student.name}</td>
            </tr>
          ))}
        </React.Fragment>
      ))}
    </tbody>
  </table>
</div>

    </div>
  );
}

export default App;
